translated.fullText:
/* Language Pills Styling */
    .lang-pills {
      display: inline-flex !important;
      gap: 10px !important;
      margin: 0 20px !important;
      align-items: center !important;
    }

    .lang-pill {
      padding: 6px 12px !important;
      border-radius: 20px !important;
      background: transparent !important;
      color: white !important;
      text-decoration: none !important;
      border: 1px solid rgba(255, 255, 255, 0.3) !important;
      transition: all 0.3s ease !important;
      font-size: 14px !important;
      font-weight: 500 !important;
    }

    .lang-pill:hover {
      background: rgba(255, 255, 255, 0.1) !important;
      border-color: rgba(255, 255, 255, 0.5) !important;
    }

    .lang-pill.active {
      background: #ffd700 !important;
      color: #1a1d3a !important;
      border-color: #ffd700 !important;
    }

    /* Fix dropdown arrow display - show as arrow instead of cube */
    .dropdown-toggle-arrow-2::after {
      content: '▼' !important;
      font-family: Arial, sans-serif !important;
      font-size: 10px !important;
      display: inline-block !important;
      margin-left: 5px !important;
      transition: transform 0.3s ease !important;
    }

    .dropdown-toggle-arrow-2::before {
      content: '' !important;
      display: none !important;
    }

    .dropdown-toggle-arrow-2 {
      font-family: Arial, sans-serif !important;
    }

    /* Rotate arrow when dropdown is open */
    .w-dropdown-toggle.w--open .dropdown-toggle-arrow-2::after {
      transform: rotate(180deg) !important;
    }

    /* Fix dropdown visibility on hover */
    .menu-dropdown-wrapper:hover .w-dropdown-list,
    .w-dropdown:hover .w-dropdown-list,
    .w-dropdown-list.w--open {
      display: block !important;
      visibility: visible !important;
      opacity: 1 !important;
      max-height: none !important;
      overflow: visible !important;
    }

    /* Dark theme dropdown styling to match Pages dropdown */
    .w-dropdown-list {
      position: absolute !important;
      z-index: 900 !important;
      background: #1a1d3a !important; /* Dark navy blue background */
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3) !important;
      border-radius: 12px !important;
      margin-top: 10px !important;
      min-width: 200px !important;
      border: 1px solid rgba(255, 255, 255, 0.1) !important;
      backdrop-filter: blur(10px) !important;
    }

    /* Style dropdown links */
    .dropdown-menu-text-link-block {
      color: white !important;
      padding: 12px 20px !important;
      display: block !important;
      transition: all 0.3s ease !important;
      text-decoration: none !important;
      border-radius: 8px !important;
    }

    .dropdown-menu-text-link-block:hover {
      background: rgba(255, 255, 255, 0.1) !important;
      color: #ffd700 !important; /* Gold color on hover */
    }

    /* Critical responsive fix for Why Choose Us section */
    @media screen and (max-width: 991px) {
      .why-choose-us-typography {
        max-width: 100% !important;
        width: 100% !important;
      }
      .why-choose-us-image-wrapper {
        max-width: 100% !important;
      }
      .why-choose-us-section-title-wrapper {
        max-width: 100% !important;
      }
    }

    @media screen and (max-width: 767px) {
      .why-choose-us-typography {
        max-width: 100% !important;
        width: 100% !important;
      }
    }

    @media screen and (max-width: 479px) {
      .why-choose-us-typography {
        max-width: 100% !important;
        width: 100% !important;
      }
      .why-choose-us-slider-wrapper {
        width: 100% !important;
        max-width: 100% !important;
      }
      .why-choose-us-slider-mask {
        max-width: 100% !important;
      }
    }

    /* Style dropdown titles if present */
    .dropdown-title {
      color: rgba(255, 255, 255, 0.6) !important;
      font-size: 12px !important;
      text-transform: uppercase !important;
      letter-spacing: 1px !important;
      margin-bottom: 10px !important;
    }

    /* Remove any default padding that creates white space */
    .dropdown-pd {
      background: transparent !important;
    }

    .dropdown-column-wrapper-3 {
      background: #1a1d3a !important;
    }

    /* Ensure dropdown stays open when hovering over it */
    .w-dropdown-list:hover {
      display: block !important;
      visibility: visible !important;
      opacity: 1 !important;
    }

    /* Mobile Menu Styles */
    @media (max-width: 991px) {
      /* Hide menu by default on mobile - slide panel from right */
      .nav-menu, .w-nav-menu {
        display: none !important;
        position: fixed;
        top: 0;
        right: -100%;
        bottom: 0;
        left: auto;
        width: 85%;
        max-width: 360px;
        background: #05051a;
        z-index: 999;
        padding: 80px 20px 20px;
        overflow-y: auto;
        transition: right 0.3s ease;
        visibility: visible !important;
        opacity: 1 !important;
      }

      /* Show menu when open */
      .nav-menu.nav-open, .w-nav-menu.nav-open {
        display: block !important;
        right: 0;
        opacity: 1 !important;
      }

      /* Style mobile menu items */
      .nav-menu .nav-link,
      .w-nav-menu .w-nav-link {
        display: block !important;
        padding: 15px 0;
        color: white;
        text-decoration: none;
        font-size: 18px;
        border-bottom: 1px solid rgba(255, 255, 255, 0.1);
      }

      .nav-menu .nav-link:hover,
      .w-nav-menu .w-nav-link:hover {
        color: #ffd659;
      }

      /* Style dropdowns in mobile */
      .nav-menu .menu-dropdown-wrapper,
      .w-nav-menu .w-dropdown {
        display: block !important;
        margin: 15px 0;
      }

      .nav-menu .dropdown-toggle,
      .w-nav-menu .w-dropdown-toggle {
        display: flex !important;
        justify-content: space-between !important;
        align-items: center !important;
        padding: 15px 0 !important;
        color: white !important;
        border-bottom: 1px solid rgba(255, 255, 255, 0.1) !important;
      }

      /* Mobile language pills */
      .mobile-language-switchers {
        display: block !important;
        padding: 15px 0 !important;
        border-bottom: 1px solid rgba(255, 255, 255, 0.1) !important;
      }

      .mobile-lang-pills {
        display: flex !important;
        gap: 10px !important;
        justify-content: center !important;
      }

      /* Mobile Sign Up button */
      .primary-button-wrapper.mobile,
      .nav-menu .primary-button-wrapper.mobile {
        display: block !important;
        margin-top: 20px;
        width: 100%;
      }

      .primary-button-wrapper.mobile .primary-button,
      .nav-menu .primary-button-wrapper.mobile .primary-button {
        width: 100% !important;
        text-align: center !important;
      }

      /* Hide desktop elements on mobile */
      .primary-button-wrapper.desktop {
        display: none !important;
      }

      .lang-pills {
        display: none !important;
      }

      .navbar-cart {
        display: none !important;
      }

      /* Hamburger animation */
      .menu-button.w--open .hamburger-line:nth-child(1) {
        transform: rotate(45deg) translate(5px, 5px) !important;
      }

      .menu-button.w--open .hamburger-line:nth-child(2) {
        opacity: 0 !important;
      }

      .menu-button.w--open .hamburger-line:nth-child(3) {
        transform: rotate(-45deg) translate(7px, -6px) !important;
      }

      .hamburger-line {
        display: block !important;
        width: 24px !important;
        height: 2px !important;
        background-color: #ffffff !important;
        margin: 0 !important;
        border-radius: 1px !important;
        transition: all 0.3s ease !important;
        position: relative !important;
      }

      /* Hamburger icon container */
      .hamburger-icon {
        width: 24px !important;
        height: 18px !important;
        position: relative !important;
        display: flex !important;
        flex-direction: column !important;
        justify-content: space-between !important;
      }

      /* Ensure navbar container has relative positioning */
      .navbar {
        position: relative !important;
      }

      /* Show menu button on mobile */
      .menu-button, .w-nav-button {
        display: flex !important;
        background: transparent !important;
        border: none !important;
        cursor: pointer !important;
        padding: 10px !important;
        position: relative !important;
        z-index: 1000 !important;
        width: auto !important;
        height: auto !important;
        align-items: center !important;
        justify-content: center !important;
      }

      .menu-button:hover .hamburger-line {
        background-color: #ffd659 !important;
      }
    }

    /* Hide mobile elements on desktop */
    @media (min-width: 992px) {
      .menu-button, .w-nav-button {
        display: none !important;
      }

      .mobile-language-switchers {
        display: none !important;
      }

      .primary-button-wrapper.mobile {
        display: none !important;
      }

      /* Show desktop nav menu */
      .nav-menu, .w-nav-menu {
        display: flex !important;
        align-items: center !important;
      }
    }

    /* SIMPLE FIX - Make all buttons work with visible text */
    .primary-button {
      background-color: #ffd659 !important;
      color: #05051a !important;
      border: 1px solid #ffd659 !important;
      border-radius: 8px !important;
      padding: 20px 30px !important;
      font-size: 16px !important;
      font-weight: 700 !important;
      text-decoration: none !important;
      display: inline-flex !important;
      align-items: center !important;
      justify-content: center !important;
      min-width: 180px !important;
      position: relative !important;
      overflow: visible !important;
      transition: all 0.3s ease !important;
    }

    .primary-button:hover {
      background-color: #ffcc00 !important;
      border-color: #ffcc00 !important;
      transform: translateY(-2px) !important;
      box-shadow: 0 10px 25px rgba(255, 214, 89, 0.3) !important;
    }

    /* Make text wrapper simple and visible */
    .primary-button-text-wrap {
      display: block !important;
      position: relative !important;
      overflow: visible !important;
      height: auto !important;
      width: auto !important;
    }

    /* Make ALL text blocks visible and properly positioned */
    .primary-button-text-block {
      display: inline !important;
      color: #05051a !important;
      font-weight: 700 !important;
      font-size: 16px !important;
      line-height: 1 !important;
      position: static !important;
      opacity: 1 !important;
      visibility: visible !important;
      transform: none !important;
      -webkit-transform: none !important;
      -moz-transform: none !important;
      -ms-transform: none !important;
    }

    /* Hide only the duplicate animated text */
    .primary-button-text-block.is-text-absolute {
      display: none !important;
    }

    /* Force override any inline transform styles */
    .primary-button-text-block[style] {
      position: static !important;
      transform: none !important;
      -webkit-transform: none !important;
      opacity: 1 !important;
      visibility: visible !important;
    }

    /* Secondary button style - FORCE transparent with yellow border */
    .primary-button.secondary,
    .primary-button.secondary.banner,
    a.primary-button.secondary {
      background-color: transparent !important;
      background: transparent !important;
      border: 2px solid #ffd659 !important;
    }

    .primary-button.secondary .primary-button-text-block,
    .primary-button.secondary.banner .primary-button-text-block {
      color: #ffd659 !important;
      opacity: 1 !important;
      visibility: visible !important;
    }

    .primary-button.secondary:hover,
    .primary-button.secondary.banner:hover {
      background-color: #ffd659 !important;
      background: #ffd659 !important;
    }

    .primary-button.secondary:hover .primary-button-text-block,
    .primary-button.secondary.banner:hover .primary-button-text-block {
      color: #05051a !important;
    }

    /* Override ALL background styles for secondary buttons */
    .primary-button.secondary[style*="background"],
    .banner .primary-button.secondary {
      background-color: transparent !important;
      background: transparent !important;
    }

